import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './App.css';
import Footer from './components/footer/footer';
import Header from './components/Header/header';
import Candidates from './components/candidates/candidates';

function App() {
  return (
    <div className="App">
      <Header />
      <body>
        <div id="page-content">
          <div class="container">
            <div class="card card-body bg-light">
            <h5 class="card-title">Welcome in voting app.</h5>
            <hr/>
            <p>Choose one candidate and submit your vote.</p>
            </div>
          <Candidates />
          </div>
        </div>
        <Footer />
      </body>
    </div>
  );
}

export default App;
